import React, { useState, useEffect } from "react";
import axios from "axios";

function HelloWorld() {
  const [message, setMessage] = useState("");
  const [surroundingLinks, setSurroundingLinks] = useState("");
  const [surroundingTitles, setSurroundingTitles] = useState("");
  const [categories, setCategories] = useState("");

  useEffect(() => {
    axios
      .get("http://localhost:8000/wikis/get-page-data/")
      .then((response) => {
        setMessage(response.data.title);

        setSurroundingTitles(JSON.parse(response.data.surrounding_titles));

        setCategories(JSON.parse(response.data.categories));

        console.log(response.data.categories);
      })
      .catch((error) => {
        console.log(error);
      });
  }, []);

  const json_length = Object.keys(surroundingTitles).length;
  const indices = [];
  for (let i = 0; i < 5; i++) {
    const index = Math.floor(Math.random() * json_length);
    while (!indices.includes(index)) {
      const index = Math.floor(Math.random() * json_length);
      indices[i] = index;
    }
  }

  let cat_index;

  for (let i = 0; i < 5; i++) {
    cat_index = Math.floor(Math.random() * Object.keys(categories).length);
  }

  return (
    <div>
      <p>{message}</p>
      <h1>Surrounding pages</h1>
      <ul>
        <li>{decodeURIComponent(surroundingTitles[indices[0]])}</li>
        <li>{decodeURIComponent(surroundingTitles[indices[1]])}</li>
        <li>{decodeURIComponent(surroundingTitles[indices[2]])}</li>
        <li>{decodeURIComponent(surroundingTitles[indices[3]])}</li>
        <li>{decodeURIComponent(surroundingTitles[indices[4]])}</li>
      </ul>
      <h1>Wiki Category</h1>
      <ul>
        <li>{decodeURIComponent(categories[cat_index])}</li>
      </ul>
    </div>
  );
}

export default HelloWorld;
